import React, { Component } from 'react';
import { Tab, Tabs } from '@blueprintjs/core';

import AppBar from '../../components/AppBar/AppBar';
import MainContainer from '../../components/MainContainer/MainContainer';
import Sidebar from '../../components/Sidebar/Sidebar';

import TestView1 from './components/TestComponent1';
import TestView2 from './components/TestComponent2';
import TestView3 from './components/TestComponent3';
import TestView4 from './components/TestComponent4';

export default class BluePrintView extends Component {
   state = {
      activeTabID: 1
   };
   handleTabChange = TabId => this.setState({ activeTabID: 1 });

   render() {
      const { activeTabIndes } = this.state;

      return (
         <div>
            <AppBar></AppBar>
            <Sidebar />
            <MainContainer>
               <Tabs
                  id='TabsExample'
                  onChange={this.handleTabChange}
                  selectedTabId={activeTabIndes}
               >
                  <Tab id='1' title='Angular' panel={<TestView1 />} />
                  <Tab id='2' title='Ember' panel={<TestView2 />} />
                  <Tab id='3' title='React' panel={<TestView3 />} />
                  <Tab id='4' title='Backbone' panel={<TestView4 />} />
                  <Tabs.Expander />
                  <input
                     className='bp3-input'
                     type='text'
                     placeholder='Search...'
                  />
               </Tabs>
            </MainContainer>
         </div>
      );
   }
}
